import React from "react";
import wise from "../images/projects/wise-code.png";

const Projects = props => (
  <div className="projects">
    <div className="project1">
      {" "}
      {/* container */}
      <div className="flip">
        {" "}
        {/* flipper */}
        <div className="front">
          <img src={wise} alt="wise-code" />
        </div>
        <div className="back">Wise-code</div>
      </div>
    </div>
    <div className="project2"></div>
    <div className="project3"></div>
    <div className="project4"></div>
    <div className="project5"></div>
    <div className="project6"></div>
  </div>
);

export default Projects;
